import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import styles from "./Foot.module.css";

const footer = [
  {
    col_number: 1,
    col_values: [
      "Countries",
      "Regions",
      "Cities",
      "Districts",
      "Airports",
      "Hotels",
    ],
  },
  {
    col_number: 2,
    col_values: [
      "Homes",
      "Apartments",
      "Resorts",
      "Villas",
      "Hostels",
      "Guest houses",
    ],
  },
  {
    col_number: 3,
    col_values: [
      "Unique places to stay",
      "Reviews",
      "Unpacked: Travel articles",
      "Travel communities",
      "Seasonal and holiday deals",
    ],
  },
  {
    col_number: 4,
    col_values: [
      "Car rental",
      "Flight Finder",
      "Restaurant reservations",
      "Travel Agents",
    ],
  },
  {
    col_number: 5,
    col_values: [
      "Curtomer Service",
      "Partner Help",
      "Careers",
      "Sustainability",
      "Press center",
      "Safety Resource Center",
      "Investor relations",
      "Terms & conditions",
    ],
  },
];

const Foot = () => {
  const list = footer.map((item) => {
    return (
      <div className="col" key={item.col_number}>
        <ul>
          {item.col_values.map((e) => {
            return (
              <li className={styles.lili} key={e}>
                {e}
              </li>
            );
          })}
        </ul>
      </div>
    );
  });
  return (
    <div className="container-flex">
      <div className="row">{list}</div>
    </div>
  );
};
export default Foot;
